sap.ui.define(["../BaseController"],function(t){var i;var e;return t.extend("asc.admin.controller.admin.EditAdminSetting",{onInit:function(){this.oRouter=this.getOwnerComponent().getRouter();this.oRouter.getRoute("editadminsetting").attachPatternMatched(this._onSettingMatched,this)},_onSettingMatched:function(t){this.settingId=t.getParameter("arguments").setting_id||this.setting_id||"0";this.getView().bindElement({path:"/"+this.settingId,model:"raw_settings"});this.setting=this.getView().getModel("raw_settings").oData[this.settingId]},onCancelPress:function(){this.oRouter.navTo("admin")},onSavePress:function(t){this.api.putSetting(this.setting.setting_id,this.setting).done(this.onSaveSettingDone.bind(this)).fail(this.onHTTPFail.bind(this))},onSaveSettingDone:function(t){this.onToast("Success!");this.oRouter.navTo("admin")}})},true);